export const region = request => {
  let firstPokemon;
  let lastPokemon;
  switch (request) {
    case 'kanto':
      firstPokemon = 1;
      lastPokemon = 151;
      break;
    case 'johto':
      firstPokemon = 152;
      lastPokemon = 251;
      break;
    case 'hoenn':
      firstPokemon = 252;
      lastPokemon = 386;
      break;
    case "sinnoh":
      firstPokemon = 387;
      lastPokemon = 493;
      break;
    case 'unova':
      firstPokemon = 494;
      lastPokemon = 649;
      break;
    case 'kalos':
      firstPokemon = 650;
      lastPokemon = 719;
      break;
  }
  return {
    firstPokemon,
    lastPokemon
  };
};
